import Buttons from "../Utils/Buttons";

const Home = () => {
    return (
        <>
            <h1>CALENDAR</h1>
            <section className="btns">
                <Buttons.Primary>Register</Buttons.Primary>
                <Buttons.Secondary>Login</Buttons.Secondary>
            </section>
        </>
    );
};

export default Home;
